def _find_assign_op(token_line: List[Any]) -> Optional[int]:
    open_brackets = ['(', '[', '{']
    close_brackets = [')', ']', '}']
    bracket_stack = []

    for i, token in enumerate(token_line):
        if token in open_brackets:
            bracket_stack.append(token)
        elif token in close_brackets:
            if not bracket_stack:
                continue
            if open_brackets.index(bracket_stack[-1]) == close_brackets.index(token):
                bracket_stack.pop()
        elif token == '=' and not bracket_stack:
            return i

    return None

