def getdoc(obj) -> Union[str, None]:
    """
    Retrieve the documentation string (docstring) of a given object in a stable manner.

    Args:
    - obj: The object for which the docstring needs to be retrieved. This object could be a function, class, method, or any other object that may contain a docstring.

    Returns:
    - Union[str, None]: If a docstring is found for the object, the function returns the docstring as a string. If no docstring is found, or if the object does not have a docstring, the function returns None.
    """
    if obj is None:
        return None

    if hasattr(obj, '__doc__') and obj.__doc__:
        return obj.__doc__

    if hasattr(obj, 'getdoc') and callable(obj.getdoc):
        return obj.getdoc()

    return None

def module_completion(line):
    if not line.startswith('import') and not line.startswith('from'):
        return []

    try:
        exec(line)
    except Exception as e:
        return []

    completions = []
    for name in dir(sys.modules[line.split()[-1]]):
        if not name.startswith('__'):
            completions.append(name)

    return completions

def _render_signature(obj_signature, obj_name) -> str:
    params = []
    for param in obj_signature.parameters.values():
        param_str = str(param)
        if param.default is not param.empty:
            param_str = param_str.replace('=', ' = ')
        params.append(param_str)

    signature_str = f"{obj_name}({', '.join(params)})"

    if obj_signature.return_annotation is not inspect.Signature.empty:
        signature_str += f" -> {obj_signature.return_annotation}"

    return signature_str

