def extract_symbols(code, symbols):
    blocks = []
    not_found = []

    # Extract all the names of variables, functions, and classes from the code
    names = [node.id for node in ast.walk(ast.parse(code)) if isinstance(node, ast.Name)]

    # Split the symbols string into a list of symbols
    symbol_list = symbols.split(',')

    # Check if each symbol is present in the names extracted from the code
    for symbol in symbol_list:
        if symbol in names:
            # Find the code block corresponding to the symbol
            symbol_block = re.search(r'\b{}\b.*?(\n\n|\Z)'.format(symbol), code, re.DOTALL)
            if symbol_block:
                blocks.append(symbol_block.group(0))
        else:
            not_found.append(symbol)

    return (blocks, not_found)

