def _format_time(timespan, precision=3):
    units = ["s", "ms", "us", "ns"]
    if timespan >= 60:
        days = timespan // (24 * 3600)
        timespan %= (24 * 3600)
        hours = timespan // 3600
        timespan %= 3600
        minutes = timespan // 60
        seconds = timespan % 60
        if days > 0:
            return f"{int(days)}d {int(hours)}h {int(minutes)}min {seconds:.{precision}f}s"
        elif hours > 0:
            return f"{int(hours)}h {int(minutes)}min {seconds:.{precision}f}s"
        elif minutes > 0:
            return f"{int(minutes)}min {seconds:.{precision}f}s"
        else:
            return f"{seconds:.{precision}f}s"
    else:
        unit_index = 0
        while timespan < 1 and unit_index < len(units) - 1:
            timespan *= 1000
            unit_index += 1
        return f"{timespan:.{precision}f} {units[unit_index]}"

