def strip_initial_indent(lines):
    # Find the minimum indentation of all non-blank lines
    min_indent = float('inf')
    for line in lines:
        if line.strip():
            indent = len(line) - len(line.lstrip())
            min_indent = min(min_indent, indent)

    # Remove the common initial indentation from each line
    for line in lines:
        yield line[min_indent:].rstrip()

