def recompute_unicode_ranges():
    largest_gap = (0, 0, 0)
    current_gap = (0, 0, 0)
    for i in range(1, 1114111):
        char_name = unicodedata.name(chr(i), "")
        if char_name == "":
            current_gap = (current_gap[0] + 1, current_gap[1], i)
        else:
            if current_gap[0] > largest_gap[0]:
                largest_gap = current_gap
            current_gap = (0, i, i)

    if current_gap[0] > largest_gap[0]:
